ALTER TABLE emissions_report
    ALTER COLUMN master_facility_id DROP NOT NULL;
    
ALTER TABLE emissions_report DROP CONSTRAINT master_facility_id_fkey;

DELETE FROM master_facility_record where program_system_code IN ('GADNR', 'DOEE');

UPDATE emissions_report 
	SET master_facility_id = NULL 
	WHERE program_system_code in ('GADNR', 'DOEE');
	



UPDATE emissions_report er
    SET master_facility_id = mfr.id
    FROM master_facility_record mfr
    WHERE mfr.eis_program_id = er.eis_program_id
    and er.program_system_code in ('GADNR', 'DOEE');
    
 
ALTER TABLE emissions_report 
ADD CONSTRAINT master_facility_id_fkey FOREIGN KEY (master_facility_id) 
    REFERENCES master_facility_record (id) MATCH SIMPLE
    ON UPDATE NO ACTION
    ON DELETE NO ACTION;
    
ALTER TABLE emissions_report ALTER COLUMN master_facility_id SET NOT NULL;
